import React from "react";
import {MDBBtn,MDBTable,MDBTableBody,} from "mdb-react-ui-kit";
import { useState } from "react";
import {FINISHTODO,DELETETODO, EDITTODO} from '../Redux/Action/action'
import { useDispatch } from "react-redux";
import Lightbox from "./NewTabEdit";

const Filter = (props) => {
  let i=0
  let y=0


const dispatch=useDispatch()


    return (
      <>

      { 
props.searchfilter === "Done" ? props.todos
      .filter((todo) => {
        return todo.isDone === true ;
      })
      .map((todo) => (  
<MDBTableBody>        
      <tr>
        <th scope="row">{i+1}</th>
        <td >{todo.description}</td>
        <td >Complete</td>
        <td>
<MDBBtn type="submit" color="danger" onClick={()=>{
  const todoToDelete = {
    id: todo.id,
    description: todo.description,
    isDone:todo.isDone,
  };
  dispatch(DELETETODO(todoToDelete))
  
}
   }>
            Delete
    </MDBBtn>
<MDBBtn type="submit" color="success" className="ms-1" disabled>
      Done
    </MDBBtn>
        </td>
      </tr>
</MDBTableBody>

))


: props.searchfilter === "Not-Yet" ? props.todos
      .filter((todo) => {if(todo.isDone===false)
        {   
             return todo.isDone === false;
        }
        else
        {
          return todo.isDone === true;
        }

      })
      .map((todo) => (
  <MDBTableBody>
      <tr key={y++}>
        <th scope="row">{i+1}</th>
        <td>{todo.description}</td>
        <td>{todo.isDone===false?'In progress':'Complete'}</td>
        <td>
          <MDBBtn type="submit" color="danger" onClick={()=>{
  const todoToDelete = {
    id: todo.id,
    description: todo.description,
    isDone:todo.isDone,
  };
  dispatch(DELETETODO(todoToDelete))
  
}
   }>
            Delete
          </MDBBtn>
          <MDBBtn type="submit" color="success" className="ms-1"  onClick={()=>{
                                  <>
                                  <Lightbox
                                    show={show}
                                    setShow={setShow}
                                    todo={todo}
                                    i={i}
                                    setHover={setHover}
                                  />
                                </>
  const todoToFinish = {
    id: todo.id,
    description: todo.description,
    isDone:true,
  };
  dispatch(EDITTODO(todoToFinish))
 
    }} >
            EditTask
          </MDBBtn>

        </td>
      </tr>
</MDBTableBody>
      ))
: props.todos.map((todo) => (
        <MDBTableBody>
<tr scope='row' key={y++}>
<th scope="row">{i+1}</th>
<td>{todo.description}</td>
<td>{todo.isDone===true ? "Complete":"In progress"}</td>
<td>{todo.isDone===true?
<>
<MDBBtn type="submit" color="danger" onClick={()=>{
  const todoToDelete = {
    id: todo.id,
    description: todo.description,
    isDone:todo.isDone,
  };
  dispatch(DELETETODO(todoToDelete))
  
}
   }>
    Delete
    </MDBBtn>
<MDBBtn type="submit" color="success" className="ms-1" disabled>
      Done
    </MDBBtn>
   
</>
:
<>
<MDBBtn type="submit" color="danger" onClick={()=>{
  const todoToDelete = {
    id: todo.id,
    description: todo.description,
    isDone:todo.isDone,
  };
  dispatch(DELETETODO(todoToDelete))
  
}}>
    Delete
    </MDBBtn>   
<MDBBtn type="submit" color="success" className="ms-1" onClick={()=>{
  const todoToFinish = {
    id:todo.id,
    description: todo.description,
    isDone:todo.isDone,
  };

  dispatch(EDITTODO(todoToFinish))
}}>
    EditTask
    </MDBBtn>

</>

}
</td>
</tr>
        </MDBTableBody>

))

}
 </>
);


}
         
export default Filter ;
